syntax = "proto3";
package tee;
message Trivial {
  int32          trivialField32   = 1;
  fixed32        trivialFieldF32  = 2;
  sfixed32       trivialFieldSF32 = 3;

  int64          trivialField64   = 4;
  fixed64        trivialFieldF64  = 5;
  sfixed64       trivialFieldSF64 = 6;

  repeated int32 repeatedField32  = 7;
  repeated int64 repeatedField64  = 8;

  message Nested {
    int64 nestedField64 = 1;
  }
  Nested         nestedMessage    = 9;
}
